        { 
          filterListCar.map(
            (carInfo, index) => <li className={index%2==0? odd-lable:even-label} key={carInfo.brand + index}> Hi, Im a {carInfo.brand}  {carInfo.color} Car</li>)}
      </ul>



    </div>
  );
}

